Dr. Andrea Davis will present a paper entitled, <em>“Beyond The Lonely Londoners: Black British Women Writers Gendering and Racing the Caribbean in London,” </em>on September 29, 2016 at the Harriet Tubman Institute from 2:30 - 4:30.
<p style="text-align: center;"><strong>Abstract</strong></p>
This paper examines the work of Beryl Gilroy and Joan Riley, two Black British writers whose novels published in the 1980s and 1990s are among the earliest literary contributions by women of Caribbean descent in reimagining the haunting histories of migration experienced by Caribbean families in London. The paper reads their identity quest narratives, <em>In Praise of Love and Children </em>(1994) and <em>The Unbelonging </em>(1985), as companion novels offering a deeply nuanced representation of Black women's experiences in the UK.

&nbsp;
<p style="text-align: center;"><strong>Bio</strong></p>
<p style="text-align: left;"><img class="size-medium wp-image-6107 alignleft" src="http://tubman.info.yorku.ca/files/2016/09/Davis-1-200x300.png" alt="davis-1" width="200" height="300" />Professor Andrea Davis is Chair of the Department of Humanities at York University. Her research focuses on Black women's literary productions. She is particularly interested in the intersections of the literatures of the Caribbean, the United States and Canada and her work encourages an intertextual cross-cultural dialogue about black women's experiences in diaspora</p>
